script: |
  super -f text -I q1110.spq | sort > q1110.out

inputs:
  - name: q1110.spq
    data: |
      SELECT COUNT ( * ) / - 86 + 49 + 83 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT IN ( col2 * 19, + col2, - - 85 * - CAST ( - 24 AS INTEGER ) );
  - name: tab1

outputs:
  - name: q1110.out
    data: |
      132
